  CardBody,
  CardFooter,
  CardTitle,
  FormGroup,
  Form,
  Input,
  Row,
  Col,
} from "reactstrap";

function Demographics() {
  return (
    <>
      <div className="content">
 <Row>
   <Col md="12">
     <Card>
    <CardHeader>
      <h5 className="title">Insert demographic charts here</h5>
    </CardHeader>
    </Card>
   </Col>
 </Row>
      </div>
    </>
  );
}

export default Demographics;
